import React from "react";
import './App.css';
import './header/header.js';
import logo from './img/logo.svg';
import nature from './img/nature.png'

function App() {
  return (
    <section className="making-section">
      <img src={nature} alt='Nature' className="background-image" />
      <div className="container">
        <div className="making__main">
          <div className="making__main-title" id="last-blog">Making brands stand out</div>
          <div className="making__main-title">is our obsession</div> 
          <div className="line"></div>
          <div className="making__main-subtitle">Let us help your brand stand out.</div>
        </div>
      </div>
    </section>
  );
}

export default App;
